    <>
      <tr>
        <td>{id}</td>
        <td>{nombre}</td>
        <td>{ci}</td>
        <td>
          <>
            <Button
              onClick={setModalShow}
              type="Submit"
              className="btn-fill "
              variant="info"
            >
              Editar
            </Button>{" "}
            <Button type="submit" className="btn-fill " variant="danger">
              Eliminar
            </Button>
          </>
        </td>
      </tr>
    </>
  );
};

